floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"324346","type":"CustomJS"},{"attributes":{},"id":"324213","type":"BasicTicker"},{"attributes":{"axis":{"id":"324212"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"324215","type":"Grid"},{"attributes":{},"id":"324279","type":"AllLabels"},{"attributes":{"label":{"value":"stdev(C,20)"},"renderers":[{"id":"324327"}]},"id":"324341","type":"LegendItem"},{"attributes":{"coordinates":null,"formatter":{"id":"324335"},"group":null,"major_label_policy":{"id":"324336"},"ticker":{"id":"324300"},"visible":false},"id":"324299","type":"LinearAxis"},{"attributes":{"coordinates":null,"group":null},"id":"324369","type":"Title"},{"attributes":{},"id":"324169","type":"BasicTicker"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"324260","type":"Segment"},{"attributes":{},"id":"324164","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"324192"},"glyph":{"id":"324234"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"324236"},"nonselection_glyph":{"id":"324235"},"view":{"id":"324238"}},"id":"324237","type":"GlyphRenderer"},{"attributes":{},"id":"324221","type":"ResetTool"},{"attributes":{"source":{"id":"324243"}},"id":"324256","type":"CDSView"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"324194","type":"CategoricalColorMapper"},{"attributes":{"data":{"Close":{"__ndarray__":"ZmZmZma2VEDhehSuR+FUQK5H4XoUPlRASOF6FK53VED2KFyPwsVUQBSuR+F6xFRAPQ
